import { useState } from "react";

function Boxie(prop){
  const [clChange,setclChange]=useState(prop.isOn)
  function toggleColor(){
    setclChange(prevColor=>!prevColor)
  }
    const cl=clChange?"#222222":"white";
    const styles ={
      backgroundColor :cl
    }
    return (
    <div style={styles} className='box' key={prop.theId} onClick={toggleColor}></div>
    )
  }
  export default Boxie
